text:
“We must uphold the rule of the law & restore trust in our institutions of democracy.

And democracy must not be a partisan issue. It must be an American issue.”

@POTUS #SOTU

“There’s no place for political violence in America.

We must protect the right to vote, not suppress that fundamental right. We must honor the results of our elections, not subvert the will of the people.”

@POTUS #SOTU

“But already, more than a dozen states are enforcing extreme abortion bans.
 
Make no mistake; if Congress passes a national abortion ban, I will veto it.”

@POTUS #SOTU

“Congress must codify Roe v. Wade to protect every woman’s constitutional right to choose.
 
@VP & I are doing everything we can to protect access to reproductive health care & safeguard patient privacy.”

@POTUS #SOTU

“In the last two years, my administration cut the deficit by more than $1.7 trillion—the largest deficit reduction in American history.

Under the previous administration, America’s deficit went up 4 years in a row”

@POTUS #SOTU

I signed a law that’ll reduce the deficit by $114B by cracking down on wealthy tax cheats.

That’s being fiscally responsible.”
 
@POTUS #SOTU

“Some Members here are threatening to repeal the Inflation Reduction Act.
 
Make no mistake, if you try to do anything to raise the cost of prescription drugs, I will veto it.”

@POTUS #SOTU

“Let’s finish the job this time.
 
Let’s cap the cost of insulin at $35 a month for every American who needs it.”

@POTUS #SOTU

“We capped the cost of insulin at $35 a month for seniors on Medicare.”

But there are millions of other Americans who are not on Medicare, including 200K young people with Type I diabetes who need insulin to save their lives.”

@POTUS #SOTU

“We passed the bipartisan infrastructure law, funding over 20K projects that’ll put hundreds of thousands of people to work rebuilding our highways, bridges, railroads, tunnels, ports & airports across America.”
 
And we’re just getting started!” 

@POTUS #SOTU

“Two years ago, our economy was reeling.
 
As I stand here tonight, we have created a record 12 million new jobs, more jobs created in two years than any president has ever created in four years.”

@POTUS #SOTU
